import Post from "../post/Post"
import "./posts.scss"

const Posts = () => {
    const posts = [
        {
            id: 11,
            name: "Raebo",
            userId: 1,
            img: "https://images.pexels.com/photos/14661921/pexels-photo-14661921.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=2"
        },
        {
            id: 22,
            name: "Raebo",
            userId: 2,
            img: "https://images.pexels.com/photos/14661921/pexels-photo-14661921.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=2"
        },
        {
            id: 44,
            name: "Raebo",
            userId: 3,
            img: "https://images.pexels.com/photos/14661921/pexels-photo-14661921.jpeg?auto=compress&cs=tinysrgb&w=1260&h=750&dpr=2"
        }
    ]
    return (
        <div className="posts">
            {posts.map((post) => {
                return (
                    <Post post={post} key={post.id} />)

            })
            }
        </div>


    )
}

export default Posts;
